from django.db import modelsfrom apps.account.models import Accountfrom apps.logus.models import RoomTypeModelVIEW_CHOICE = (    ("residential", "residential"),    ("mountains", "mountains"),    ("river", "river"),)class RoomModel(models.Model):    room_number = models.CharField(max_length=50)    is_free = models.BooleanField(default=False)    count = models.IntegerField(default=0)    floor = models.IntegerField(default=1)    view = models.CharField(max_length=200, default="residential")    room_type = models.ForeignKey(RoomTypeModel, on_delete=models.CASCADE)    capacity = models.IntegerField()    created_by = models.ForeignKey(Account, related_name="room", on_delete=models.SET_NULL, null=True)    created_at = models.DateTimeField(auto_now_add=True)    modified_at = models.DateTimeField(auto_now=True)    modified_by = models.ForeignKey(Account, related_name="modf_room", on_delete=models.SET_NULL, null=True)    def __str__(self):        return f"{self.room_number} - {self.is_free} - {self.room_type} - {self.capacity}"